INSERT INTO contacts (first_name,last_name,email_primary,email_secondary,company,website,company_linkedin,imdb,facebook,instagram,linkedin,wikipedia,biography,priority,seen_film,doc_branch_member,location_country,location_state,location_city,location_state_text,location_city_text,is_active,created_at) VALUES ('Aaron','Wickenden',NULL,NULL,NULL,NULL,NULL,'https://pro.imdb.com/name/nm1704972/',NULL,'https://www.instagram.com/aaron.wickenden/','https://www.linkedin.com/in/aaron-wickenden-150273/',NULL,'I believe as Roger Ebert did that “...movies are like machines that generate empathy.” For me, that transformative process happens most dynamically with documentaries. I’ve devoted myself for nearly two decades across more than 20 feature films, primarily as editor, to an artistic storytelling discipline that aims for inventive storytelling, emotional resonance, social impact and mass communication. Over my career I’ve been entrusted with the responsibility and honor of crafting: raw footage by Orson Welles, personal family footage from the Obama family, and unseen footage from across Anthony Bourdain’s entire career. 
